import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import ButtonBase from "@material-ui/core/Button";
// slider
import image1 from "./pace_1.jpg";
import image2 from "./pace_2.jpg";
import image3 from "./pace_3.jpg";
import Slider from "react-slick";
//css for container
import "./index.css";

const styles = makeStyles((theme) => ({
  name: {
    marginBottom: "5%",
    textShadow: "5px 3px 5px black",
    color: "white",
  },
  sign_up: {
    marginLeft: "100px",
    marginRight: "100px",
    padding: "10px 50px",
    borderRadius: "100px 100px 100px 100px",
  },
  login: {
    marginLeft: "100px",
    marginRight: "100px",
    padding: "10px 57px",
    borderRadius: "100px 100px 100px 100px",
  },
  slider: {
    dots: "true",
    infinite: "false",
    speed: "500",
    slidesToShow: "1",
    slidesToScroll: "1",
  },
}));

export default function POTNLogo() {
  const classes = styles();

  return (
    <div className="container">
      <div>
        <Slider className="slider">
          <div>
            <img src={image1}></img>
          </div>
          <div>
            <img src={image2}></img>
          </div>
          <div>
            <img src={image3}></img>
          </div>
        </Slider>
      </div>
      <div className="centered">
        <div className={classes.name} style={{ WebkitTextStroke: "1px grey" }}>
          Princeton Online Tutoring Network
        </div>
        <ButtonBase className={classes.sign_up} variant="outlined">
          SIGN UP
        </ButtonBase>
        <ButtonBase className={classes.login} variant="outlined">
          LOGIN
        </ButtonBase>
      </div>
    </div>
  );
}
